Главным Управлением МЧС России по Самарской области в рамках соглашения о взаимодействии с Региональным Общественным Учреждением Добровольная Пожарно-Спасательная Команда «Службы спасения Самарской области»
В городе Новокуйбышевске на площади у ТЦ «Сити-Парк» состоялось первое построение добровольцев Регионального Общественного Учреждения Добровольной Пожарно-Спасательной Команды «Службы спасения Самарской области». На смотр прибыла автоколонна спецтехники, применяемой при чрезвычайных ситуациях природного и техногенного характера, так же при аварийно-спасательным работам при ДТП с участием большегрузного транспорта. На обозрение были выставлены аварийно-спасательные автомобили, автомобили первой помощи, пожарные машины, эвакуатор для грузовых автомобилей. Добровольцы демонстрировали свои возможности и состояние материально-технической базы. В торжественной обстановке руководитель Аварийно Пожарно-Спасательного Формирования «Службы спасения» Андрей Пожидаев передал добровольцам спецавтотранспорт — две пожарные автоцистерны марки ЗИЛ-130.
 Главная цель мероприятия — смотр боеготовности, совершенствование профессионального мастерства личного состава добровольной пожарной команды области, непосредственно связанного с ведением боевых действий по тушению пожаров, выработка психологических и физических качеств, необходимых для выполнения работ в экстремальных условиях.
 Осмотреть представленную технику и личный состав добровольцев РОУ ДПСК «Службы спасения Самарской области» прибыли: Начальник гарнизона пожарной охраны полковник внутренней службы Емельянов Владимир Геннадьевич, который в полной мере оценил профессионализм бравых бойцов, находящихся в его оперативном подчинении; а так же на данном мероприятии находился руководитель Управления по делам ГО ЧС администрации г.о. Чапаевск Моторин Вадим Александрович. С данным городским округом ведутся переговоры о создании на их территории обособленного подразделения добровольной пожарно-спасательной команды. Переговоры о создании добровольных команд так же ведутся с администрацией Волжского района.
